import { useState } from "react";
import Board from "./Board";
import History from "./History";

export const App = () => {
  const [histories, setHistories] = useState([new Array(9).fill(null)]);
  const [gameState, setGameState] = useState(histories[0]);
  const handleStateChange = (newGameState) => {
    setGameState(newGameState);
  };
  return (
    <div className="game">
      <Board gameState={gameState} handleStateChange={handleStateChange} />
      <History
        histories={histories}
        onSelectHistory={(gameState) => {
          setGameState([...gameState]);
        }}
      />
    </div>
  );
};

export default App;
